import 'whatwg-fetch';

class HttpService{
    getBloodReqs = () =>{
        var promise = new Promise((resolve, reject) => {
            fetch('http://172.20.104.188:3004/bloodReq')
            .then(response => {
                resolve(response.json());
            })
        });
        

        
        return promise;
    }   
}


export default HttpService;
